// routes/post.ts
import http from 'http';
import Post from '../models/Post';

const postRouter = http.createServer((req, res) => {
  if (req.method === 'POST') {
    const { content, image, name } = req.body;
    const post = new Post({ content, image, name });
    post.save((err) => {
      if (err) {
        res.statusCode = 500;
        res.end('新增貼文失敗');
      } else {
        res.statusCode = 201;
        res.end('新增貼文成功');
      }
    });
  } else {
    res.statusCode = 405;
    res.end('Method Not Allowed');
  }
});

export default postRouter;
```
