// server.ts
import http from 'http';
import postRouter from './routes/post';

const server = http.createServer((req, res) => {
  if (req.url === '/post') {
    postRouter(req, res);
  } else {
    res.statusCode = 404;
    res.end('Not Found');
  }
});

server.listen(3000, () => {
